import React from "react";

function Footer() {
  return (
    <>
      <div>
        <h1 className="mx-auto p-6 bg-white rounded-lg text-l mt-3">
          Modern Food Tales
        </h1>
        <h6 className="mx-auto bg-white rounded-lg text-l">Follow Us</h6>
      </div>
    </>
  );
}

export default Footer;
